import React from "react";
import classes from "./mainsec.module.css"
const Mainsec = () => {
  return (
      <div className={classes.center}>
          <h1 className={classes.tx}>
              Crypto Tracker
          </h1>
          <ul><li><div class="big-stats-content"><div class="big-stats-title"><a href="/en/market-cap-charts/">Market Cap</a></div><div class="big-stats-value"><a href="/en/market-cap-charts/"> $1,734,849,656,461</a><div class="big-stats-percent-block"><a class="percent-wrapper text-up" href="/en/market-cap-charts/"><span class="icon-priceUp"></span><span>0.89%</span></a></div></div></div> </li><li><div class="big-stats-content"><div class="big-stats-title"><a href="/en/market-cap-charts/">Volume 24h</a></div><div class="big-stats-value"><a href="/en/market-cap-charts/"> $180,622,386,862</a><div class="big-stats-percent-block"><a class="percent-wrapper text-down" href="/en/market-cap-charts/"><span class="icon-priceDown"></span><span>-6.02%</span></a></div></div></div> </li><li><div class="big-stats-content"><div class="big-stats-title"><a href="/en/market-cap-charts/">BTC Dominance</a></div><div class="big-stats-value"><a href="/en/market-cap-charts/"> 60.30%</a><div class="big-stats-percent-block"><a class="percent-wrapper text-up" href="/en/market-cap-charts/"><span class="icon-priceUp"></span><span>1.21%</span></a></div></div></div> </li></ul>
      </div>
   )
};

export default Mainsec;
